import "./App.css"
import Task2 from "./function2"
function Task(){
    const id ="01"
    const name="T.Nishanth"
    const city="Bangalore"
    const state="Karnataka"
    const mobile="9876543210"
    return(
       
        <div> 
           <Task2 id={id} name={name} city={city} state={state} mobile={mobile}/>
        </div>
    )
}
export default Task;
